/**
 *  PlasmaHomeDsTheme.OnLight
 */
@Composable
public fun PlasmaHomeDsTheme.OnLight(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkOnLightColors
    } else {
        lightOnLightColors
    }
    val gradients = if (isDark) {
        darkOnLightGradients
    } else {
        lightOnLightGradients
    }
    PlasmaHomeDsTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
